import Card from "../UI/Card/card";
import Classes from "./main.module.css";

const Main = (props) => {
  return (
    <main className={Classes.mainPage}>
      <Card class={Classes.mainCard}>
        <h1>{props.city}</h1>
        <div className={Classes.temperature}>{props.temperature}&#8451;</div>
        <img src={props.icon} loading="lazy" alt="icon"></img>
        <h2>{props.WeatherText}</h2>
      </Card>
    </main>
  );
};

export default Main;
